import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom'
import './App.css';


import Navbar from './components/Navbar'
import Home from './components/screens/Home'

function App() {
  return (
    <div className="App">
      <Navbar />
      <Home />
    </div>
  );
}

export default App;
